   "source": [
    "# Introduction\n",
    " \n",
    "\"Needing insurance is like needing a parachute. If it isn´t there the first time, chances are you won´t be needing it again.\"\n",
    "\n",
    "\n",
    "How insurances operate has been often times fascinating to me in the way of when eventually filling a claim after months or even years of payments, the use of the service may end up costing you with an increased rate.  \n",
    "That aside, the impact of health factors such as age, Body Mass Index (BMI) and blood pressure on insurance claims serves as a fun project that presents a way to gain a better understanding and insights on the operation of insurances. The following points will be investigated to grasp the goal:\n",
    "\n",
    "1.Identifying trends in insurance claims based on age, gender, BMI, and blood pressure.\n",
    "\n",
    "2.Investigating correlations between health traits (such as BMI and blood pressure) with the likelihood of making a claim\n"
   ]
  },
