   "source": [
    "# Overview\n",
    "\n",
    "\n",
    "**Relationship between age, gender and claims:**\n",
    "\n",
    "An immediate observation is the abundance of female claims over age of 50 while also a lack of claims for females under the age of 25. Interesting enough, there is an inverse with the males, lack of claims over the age of 50. This presents an engaging point to follow during the investigative analysis on if an answer could be determined for the lack of male claims over the age of 50.\n"
   ]
  },
