   "source": [
    "**Obese Body Mass Index**\n",
    "\n",
    "An obese Body Mass Index (BMI) is scored at a value over 30.This subgroup not only accounts for a larger percentage of all claims but is also responsible for higher insurance claim cost. To make a comparison, individuals considered obese accounted for three times as much insurance claims. This severity shows a higher risk factor and most vulnerable in filling a claim. \n"
   ]
