   "source": [
    "# Health Factor: Blood Pressure\n",
    "\n",
    "According to [Centers for Control of Disease and Prevention](https://www.cdc.gov/bloodpressure/about.htm), the higher the blood pressure levels, the more risk you have for other health problems, such as heart disease, heart attack, and stroke. High blood pressure is defined as a systolic pressure of 130 or higher.\n",
    "\n",
    "Individuals at risk for high blood pressure had a higher minimum monetary claim value around $26,000, although fewer overall claims in total but a very costly starting point in comparison to the rest. \n"
   ]
