   "source": [
    "Similarly to the risks of high blood pressure, individuals that are at risk of pre-hypertension (high blood pressure) also share the comparable analysis with the aforementioned group. This includes fewer claims but also a higher minimum monetary claim amount. \n",
    "Another key point that should have leaped off the previous and following plot is the relationship between an individual being a smoker and the claim amount. There appears to be a strong positive correlation between smokers and high claims monetary amount.\n"
   ]
