    "# Health Factor: Diabetic\n",
    " \n",
    "Diabetes causes damage by scarring the kidneys, which in turn leads to other possible health risks that are responsible for raising blood pressure.\n",
    "There happens to be no strong correlation between diabetics and claim amounts. Both diabetics and non-diabetics show comparable results in this analysis.\n"
