   "source": [
    "# Conclusion\n",
    "\n",
    "On average, males insurances claims were more likely to result in a higher insurance bill when compared to the females. Which held firm when analyzing the over age 50 subgroup which the women far outnumbered men.\n",
    "Health traits such as BMI and blood pressure saw a noticeable trend on insurance claims. People at risk of pre hypertension, high blood pressure, overweight, and obesity all have a costly insurance bill. No strong correlation was detected if the individuals were diabetic or non-diabetic. In a surprise and not so shocking aspect, smokers were also at an higher risk in filling a costly claim. \n",
    "Health factor risks contributes greatly in the relationship between the severity and amount filled, making it understandable on why certain characteristics would lead to different insurances rates to help the companies account for the likelihood of an enormous bill."
   ]
  }
